function Get_Dis_BF_Rate(be){
    var x = 0;
    if(be>=40){ x = 0.4;}
    else if(be>=30){x = 0.3;}
    else if(be>=20){x = 0.2;}
    else if(be>=15){x = 0.1;}
    else if(be>=12){x =0.05;}
    return x;
}
/*
���㱣���ۿ�
Ͷ����	>=12W	>=15W	>=20W	>=30W	>=40W
�ۿ���	0.05	0.1	      0.2	 0.3     0.4
*/
function dis_bf(bf,be){         //bf-����,be-����
    var Dis_rate,x;
    Dis_rate = Get_Dis_BF_Rate(be);
    x = bf - Dis_rate
    return x*be*10 ;
}

