function Get_Basci_BF(strBF,strNian,strAge){  //strBF-������ʱ�ı���  strNian- �������� strAge-������
    var arrTBL = new Array() ;
    //��ȡ��֤�˱���
    for (var i=1; i<=20; i++){
        arrTBL[i] = parseInt(tuibaoliu(strNian,i)*strBF);

    }
//�ж�25����Ƿ��Ѿ���85��
    if(strAge+25>85){
        arrTBL[25] = 10000;}else{
        arrTBL[25] =  parseInt(tuibaoliu(strNian,25)*strBF);}
//�ж�30����Ƿ��Ѿ���85��
    if(strAge+30>85){
        arrTBL[30] = 10000;}else{
        arrTBL[30] =  parseInt(tuibaoliu(strNian,30)*strBF);}
//����66��-11��Ļ����˱���ֵ
    for (var i=66; i<86; i+=5){
        arrTBL[i] = parseInt(tuibaoliu(strNian,i-strAge)*strBF); }

//����66��-11��Ļ����˱���ֵ
    for (var i=86; i<=101; i+=5){
        arrTBL[i] = 10000; }

    return arrTBL;
}
