function Get_Adjust(area,sex,age,nian,smoke,be){
    var hk_BF,Dis_rate,now_BF,BF_dis;
    var Risk_BF,Sex_Rate;
//���㱣���ۿ��ʱ����ۿ��ʣ�(HK(��/��)���ѣ���/Ů���������ۿۣ�/��ʱ����
    hk_BF = chk_bfl(0,sex,smoke,nian,age)	; //������۵ı���
    BF_dis = Get_Dis_BF_Rate(be) ; //���㱣���ۿ�
    now_BF = chk_bfl(area,sex,smoke,nian,age); //��ʱ����
    Dis_rate = (hk_BF -BF_dis)/now_BF ; //�����ۿ���
//B.���ձ����ʣ���ʱ���ѣ���۷����̱��ѣ�/��۷����̱���
    Risk_BF = (now_BF - chk_bfl(0,sex,0,nian,age))/chk_bfl(0,sex,0,nian,age);

//�Ա��������:Ů��0	�У�(HK�зǱ��ѣ�HKŮ�Ǳ��ѣ�/HKŮ�Ǳ���
    Sex_Rate = 	(chk_bfl(0,sex,0,nian,age)-chk_bfl(0,1,0,nian,age))/chk_bfl(0,1,0,nian,age);

//���ѵ������� = �����ۿ���*��1+���ձ����ʣ�*��1+�Ա�������ӣ�
    return Dis_rate*(1+Risk_BF)*(1+Sex_Rate);
}

